import React, { useContext } from 'react';
import { Link } from 'react-router-dom';
import { Navbar, Nav, Container } from 'react-bootstrap';
import AuthContext from './AuthContext.jsx';

function CustomNavbar() {
  const { isLoggedIn, logout } = useContext(AuthContext);

  const handleLogout = () => {
    logout();
    window.location.href = '/';
  };

  return (
    <Navbar bg="light" expand="lg" className="mb-4">
      <Container>
        <Navbar.Brand as={Link} to="/">Webshop</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link as={Link} to="/">Home</Nav.Link>
            <Nav.Link as={Link} to="/products">Products</Nav.Link>
            {!isLoggedIn && <Nav.Link as={Link} to="/register">Register</Nav.Link>}
            {!isLoggedIn && <Nav.Link as={Link} to="/login">Login</Nav.Link>}
            {isLoggedIn && <Nav.Link as={Link} to="/mydata">My Data</Nav.Link>}
            {isLoggedIn && <Nav.Link as={Link} to="/productedit">Product Edit</Nav.Link>}
            {isLoggedIn && <Nav.Link as={Link} to="/admin">Admin</Nav.Link>}
            {isLoggedIn && <Nav.Link as={Link} to="/user">User</Nav.Link>}
            {isLoggedIn && <Nav.Link onClick={handleLogout}>Logout</Nav.Link>}
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default CustomNavbar;
